import React, { Component } from "react";

class counter extends Component {
  state = {
    count: 0,
  };

  handleClick = (count) => {
    count++;
  };

  render() {
    return (
      <div>
        <span>Count: {this.state.count}</span>
        <button onClick={this.handleClick}>Increment</button>
      </div>
    );
  }
}

export default counter;
